import React,{Component} from 'react';
import {Table} from 'reactstrap';

export default class SharedTable extends Component{
	constructor(props){
		super(props);
		this.convertArray=this.convertArray.bind(this);
		this.state={data:[]}
	}

	componentDidMount(){
		var url='';
		if(this.props.types==='mount'){

		}
	}
  convertArray=(obj) =>{
    const item=[];
    Object.keys(obj).forEach(function(key) {
      item.push(obj[key]);
    });

    return item;
  };
	render(){
		console.log(this.props)
		const header=this.props.header.map((k)=>{
			return(
				<th>{k}</th>
			)
		});
		const data=this.convertArray(this.props.dataValue);
		const parsedData=data.map((k,i)=> {
			return(
				<tr>
					{this.props.tdValues.map((e)=> {
						{if(e==='isFlying'){
							return <td>Flying: {k[e] ? 'Yes' : 'No'}</td>
						}else if(e==='isGround'){
							return <td>Ground: {k[e] ? 'Yes' : 'No'}</td>
						}else if(e==='image'){
							return <td>{this.props.charImg(k.id,0)}<br />{this.props.charImg(k.id,1)}</td>
						}else{
							return<td>{k[e]}</td>
						}}
					})}
				</tr>
			)
		});
		console.log(parsedData);

		return(	
			<Table>
				<thead>
					{header}
				</thead>
				<tbody>
					{parsedData}
				</tbody>
			</Table>
		)
	}
}
